import './App.css';

function App() {
  return (
    <div>
      <div className="full-page-container">
        <h1>Mann eller Kvinne?</h1>
        <p>Skriv inn tekst og sjekk om </p>
        <textarea></textarea>
        <p>Denne teksten er skrevet av en: </p>
        <p><b>YEEET</b></p>
        <p>Sannsynligheter</p>
      </div>
      <p>Denne siden bruker maskinlæring for å gjøre antagelser</p>
      <a href="https://github.com/LBlend/mann-eller-kvinne">Kildekode</a>
    </div>
  );
}

export default App;
